    class HeatingCurves{
        constructor(Afloor, UaBui, TambDesign){
            this.floorHeating = "false";
            this.Afloor = Afloor;
            this.UaBui = UaBui;
            this.TambDesign = TambDesign;
        }

        getDesignSpaceHeatLoad(){
            var QDesign = this.UaBui * (20-this.TambDesign);
            return QDesign;
        }
        getQRad75to65(){
        // heating power of radiators at 75/65/20 according to Recknagel Sprenger,
			const noOfRad = 14; //in m length, 2 for three bedrooms and office each (=8), 4 for kitchen & living, one for two baths each (=2)
			const pPerRad = 1400;  // Recknagel-Sprenger for 0.55 m height and 100 m depth surface vertical corrugated plate radiator, W per m
			var QRad = noOfRad * pPerRad; // Watt
			return QRad; // W
        }
        getQFloor45to35(){
        	// heating power of floor with wood surface (parkett) at 45/35/20
			// for tiles use 93 W/m2, for carpet 73 W/m2
			var Qfloor = 61 * this.Afloor;
			return Qfloor;
        }

        getTSupplyNom(){

            if (this.floorHeating) {
				var tFloorDesign = 20 + 20 * Math.pow((this.getDesignSpaceHeatLoad()/this.getQFloor45to35()),1/1.1);
				var TSupplyNom = tFloorDesign + this.getDesignSpaceHeatLoad()/this.getQFloor45to35() * 5;
				// window.alert('TSupplyNom ' & TSupplyNom);
			}
			else{
				var tRadDesign = 20 + 50*Math.pow((getDesignSpaceHeatLoad()/getQRad75to65()),1/1.3);
				var TSupplyNom = tRadDesign + getDesignSpaceHeatLoad()/getQRad75to65() * 5;
			}
			return TSupplyNom;
        }

        getTSupply(taN, trSet, tflN, ta, floorHeating){
            //method to calculate flow temperature setpoint of heating system
            // taN = nominal ambient temperature in Â°C
            // trSet = room set point temperature in Â°C
            // n = heating system exponent: 1.1 for radiators, 1.3 for floors
            // tflN = nominal flow temperature of heating system (at nominal ambient conditions)
            // ta = actual ambient temperature in Â°C
            // night-time reduction can be achieved by feeding lower trSet...

            let n;
            let tsupply;

            if (floorHeating) {
                n = 1.1;
            } else {
                n = 1.3;
            }
            tsupply = trSet + (tflN-trSet) * Math.pow( Math.max((trSet- ta ),0) /(trSet-taN) ,(1/n));
            return tsupply;
            }
        }

	class Building{
		constructor(){
			// building properties - general
			const hlength = 10; // m
			const hwidth = 7; // m
			const hstorey = 3; // m, height of each storey
			const noFloors = 2; // -, whole numbers
			
			// wall property (without insulation) does not change
			this.Uwalls = 1.2; // W/(m2K) ohne isolation, monolithisch

			// elements of the building by area in m2:
			this.Afloor = noFloors*hlength*hwidth; // total floor area
			this.Awindows = 42;
			this.Awalls = 2*(hlength + hwidth)*hstorey*noFloors - this.Awindows;
			this.Aroof= 1.5 * hlength*hwidth;

			// thermal capacity of walls in J/(m2K) and J/K
			this.CwallSpec= 300* 1000;
			this.Cwalls= this.CwallSpec * this.Awalls;

			// convert ventilation and infiltration losses to UAairchange
			this.AirVolume = this.Afloor*3;


			// Gains, Room Temperature, and number of inhabitants
			let NrOfPersons = getNrPers();
			this.SolarGainFactor = 0.2;
			this.powerInternalGainPersons = NrOfPersons*100*0.5; // 100 W per person, 50% presence
			
			// electric gains to be updated based on electric appliances
			this.powerInternalGainEl = 184; // W
			this.UaBui = 0; // initialisieren
		}
		
		updateIntGainEl(totalAnnualEltoHeat){
			this.powerInternalGainEl = totalAnnualEltoHeat/8760*1000;
		}
		
		sim(){
			
			// read building settings
			var e = document.getElementById("uwallins");
			this.Uinsulation = e.value;
			var e = document.getElementById("uroof");
			this.Uroof = e.value;
			var e = document.getElementById("uwin");
			this.Uwindows = e.value;
			var e = document.getElementById("luftw");
			this.effectiveAirchange = e.value;	
			var e = document.getElementById("tsv");
			this.TroomSet = e.value;				
			
			// UA-values in W/K
			this.UAwindows = this.Uwindows * this.Awindows;
			this.UAroomMidwall= this.Awalls/(0.5/this.Uwalls + 1/7); // 7 W/m2K is alpha convective from room air to wall
			this.UAmidwallOutside= this.Awalls/(0.5/this.Uwalls + 1/this.Uinsulation + 1/10); // 10 W/m2K is alpha convective from outside air to wall
			this.UAwall = this.Awalls/(1/this.Uwalls + 1/this.Uinsulation + 1/10 + 1/7);  // total wall Ua-Value
			this.UAroof = this.Uroof * this.Aroof;
			this.UAairchange = this.effectiveAirchange*this.AirVolume/3.6;  // W/K
			

			// resulting heating energy in kWh
			this.EtotHeating = 0;

			// Update UA-Values (W/K)
			this.UAwindows = this.Uwindows * this.Awindows;
			
			this.UAroomMidwall = this.Awalls/(0.5/this.Uwalls + 1/7);
			this.UAmidwallOutside = this.Awalls/(0.5/this.Uwalls + 1/this.Uinsulation + 1/10);
			this.UAwall = this.Awalls/(1/this.Uwalls + 1/this.Uinsulation + 1/10 + 1/7);  // total wall Ua-Value
			this.UAroof = this.Uroof * this.Aroof;
			this.UAairchange = this.effectiveAirchange*this.AirVolume/3.6; // W/K
			this.UaBui = this.UAwindows + this.UAwall + this.UAroof + this.UAairchange + 1/(1/this.UAroomMidwall+1/this.UAmidwallOutside);
			
			this.Troom = this.TroomSet;
			this.Twall = [18];
			this.powerWindows = [0]; // all power terms in Watt (average of day)
			this.powerRoof = [0];
			this.powerAirchange = [0];
			this.powerRoomWall = [0];
			this.powerWallOutside = [0];
			this.powerSolarGain = [0];
			this.powerInternalGain = [0];
			this.powerBalance = [0];
			this.powerHeating = [0];
			this.dTwall = [0];
			const TambD = climateD['Tamb'];
			const IhorD = climateD['Ihor'];
			
			let dTroomAmb;
			
			for (let i = 0; i < NrOfDays; i++) {

				dTroomAmb = this.Troom - TambD[i];

				this.powerWindows[i] = - this.UAwindows*dTroomAmb;
				this.powerRoof[i] = -this.UAroof * dTroomAmb;
				this.powerAirchange[i] = - this.UAairchange*dTroomAmb;
				this.powerRoomWall[i] = - this.UAroomMidwall*(this.Troom - this.Twall[i]);
				this.powerWallOutside[i] = this.UAmidwallOutside*(this.Twall[i]-TambD[i]);
				this.powerSolarGain[i] = this.SolarGainFactor*this.Awindows*IhorD[i];
				this.powerInternalGain[i] = this.powerInternalGainEl+this.powerInternalGainPersons;
				this.powerBalance[i] =  this.powerAirchange[i] + this.powerRoomWall[i] + this.powerRoof[i] + this.powerWindows[i] + this.powerSolarGain[i] + this.powerInternalGain[i];

				this.powerHeating[i] = Math.max(-this.powerBalance[i],0.0);

				this.dTwall[i] = (-this.powerRoomWall[i]-this.powerWallOutside[i])*24*3600/this.Cwalls;
				if (i<NrOfDays-1){
					this.Twall[i+1] = this.Twall[i] + this.dTwall[i];
				}
				this.EtotHeating = this.EtotHeating + this.powerHeating[i]*24/1000;

			}
			this.EtotperArea = Math.round(this.EtotHeating/this.Afloor*100)/100;
			document.getElementById('heattotal').innerHTML = Math.round(this.EtotHeating);
			document.getElementById('heatspec').innerHTML = this.EtotperArea;
				
		}
		getAfloor(){
		    return this.Afloor;
		}
	}
	
