			for (let i = 0; i < 8760; i++) {
				HHbasetotal = HHbasetotal + this.elHouseholdBaseH[i]/1000;
			}
			// calculate factor for actual electric household consummption compared to base profile
			factor = this.elTotal/HHbasetotal;

