	class PvCalc {
		
		constructor(){
			// pv efficiency values, reference is gross area 
			this.etaPvNom = 0.20; // efficiency of PV panel under nominal conditions (1000 W/m2, 25 Â°C) 
			this.noct = 48; // temperature of PV-cell with 1 m/s wind and 800 W irradiance normal to the PV plane, ideale HinterlÃ¼ftung 
			this.beta = -0.45; // temp. coefficient: performance decrease in % efficiency per K temperature... 
			this.etaCableSoilDegrad = 0.93; // efficiency loss by cable, soiling, IAM and degradation; 
			this.etaWRnom = 0.95;
			this.results = false;
			
			this.Icoll = climateH['Icoll'];
			this.Tamb = climateH['Tamb'];
		}
		
		sim(pvArea){
			// returns the collector yield per m2 for collector mean temperature tColl 
			let tCell;
			let iSol;
			let etaPv;
			let pPvDc;
			let etaWR;
			
			this.pvArea = pvArea;  // m2, PV area
			this.pPvAcSpec = [0];  // W/m2, specific yield
			this.pPvAc = [0];	// W, yield on total fiel
			this.ePvAcTotSpec = 0;  // kWh/m2, total specific energy
			
			for (let i = 0; i < 8760; i++) {
				iSol = this.Icoll[i];
				tCell = this.Tamb[i] + (this.noct+10-20)/800*iSol;  // Zelltemperatur, +10 K zu noct dazugeschlagen wegen Ã¼blicherweise nicht idealer HinterlÃ¼ftung 
				etaPv = this.etaPvNom*(1+this.beta*(tCell-25)/100);  // Wirkungsgrad unter BerÃ¼cksichtiung der Temperaturkorrektur 
				pPvDc = this.etaCableSoilDegrad*etaPv * iSol;  // DC-Leistung PV pro m2 
				etaWR = Math.exp(-1/(0.2*iSol))*this.etaWRnom; // Wirkungsgrad Wechselrichter unter BerÃ¼cksichtigung des Schwachlastabfalls 
				this.pPvAcSpec[i] = etaWR*pPvDc; // AC Power vom Wechselrichter... 
				this.pPvAc[i] = this.pPvAcSpec[i]*this.pvArea; // total yield on field
				this.ePvAcTotSpec = this.ePvAcTotSpec + this.pPvAcSpec[i]/1000;
			}
			this.results = true;
			this.ePvAcTot = this.ePvAcTotSpec*this.pvArea;
			return this.ePvAcTot;
		}
		
		getPvAc(pvArea){
			if (this.results == false) {
				let ePVAcTot = this.sim(pvArea);
			}
			document.getElementById('pvyield').innerHTML = Math.round(this.ePvAcTot*100)/100;
			return this.pPvAc;	
		}
		
	}

	class SelfCon {
		constructor(){
			this.PvToHome = [0];
			this.PvToGrid = [0];
			this.GridToHome = [0];

		}
		
		sim(PvAc, HhLoad){
			this.PvToHomeTot = 0;
			this.PvToGridTot = 0;
			this.GridToHomeTot = 0;
			for (let i = 0; i < 8760; i++) {
				this.PvToHome[i] = Math.min(PvAc[i],HhLoad[i]);
				this.PvToGrid[i] = PvAc[i] - this.PvToHome[i];
				this.GridToHome[i] = HhLoad[i] - this.PvToHome[i];
				
				this.PvToHomeTot = this.PvToHomeTot + this.PvToHome[i]/1000;
				this.PvToGridTot = this.PvToGridTot + this.PvToGrid[i]/1000;
				this.GridToHomeTot = this.GridToHomeTot + this.GridToHome[i]/1000;
			}
			
			document.getElementById('pvtohome').innerHTML = Math.round(this.PvToHomeTot*100)/100;
			document.getElementById('pvtogrid').innerHTML = Math.round(this.PvToGridTot*100)/100;
			document.getElementById('gridtohome').innerHTML = Math.round(this.GridToHomeTot*100)/100;
		}
		
		
	}

